                <div><a>News</a></div>
                <div><a>Music</a></div>
                <div><a>Settings</a></div>
            </nav>


            <div className='content'>
                <img src={fon} className="fon"/>

          <div><img src={seagull}/>ava + description</div>
                <div>my post</div>
                <div>new post</div>
                <div>post 1</div>
                <div>post 1</div>
